message:
Apresentando o Brasil a autoridades no Qatar

1/2 Sheikha Hind bint Hamad Al Thani, CEO da Qatar Foundation, nos apresentou seu grandioso projeto educacional e abriu portas para intercâmbios e pesquisas no Brasil. A estrutura da Qatar Foundation impressiona;

3/4 Min. Energia, Saad Sherida Al-Kaabi. Além do diesel em pauta também o gás;

5 CEO da QIA (Qatar Investement Authority), Mansoor bin Ebrahim Al-Mahmoud, que já têm presença no Brasil;

6/7 Conhecendo a Qatar Free Zone Authority, zona franca de porto e aeroporto, excelente hub de entrada para nossos produtos na região;

8 Min. da Municipalidade AbdulLa bin Abdulaziz bin Turki Al-Subaie, que gerencia a infraestrutura nacional. Ele nos convidou para a Qatar Expo, excelente oportunidade para empresas brasileiras que desejam se projetar para 80 países;

9/10 Com empreendedores brasileiros onde farão a Casa Brasil para a Copa
